(1, 'BluCollection', '1', NULL, 'http://youtu.be/0fvq8YY28qI', NULL, '0fvq8YY28qI', 'https://i1.ytimg.com/vi/0fvq8YY28qI/default.jpg', 'https://i1.ytimg.com/vi/0fvq8YY28qI/hqdefault.jpg', 'youtube', 'drama', 'Rip Clutchgoneski Micro Drifters Cars Gold Francesco Bernoulli, Miguel Camino, Ramone Sheriff Disney', 'From disney pixar cars 2, here we have 3 brand new packages of micro-drifters with rip clutchgoneski, miguel camino "world grand prix lightning McQueen". Package 2 we have "gold Francesco Bernoulli" "raoul caroule" "jeff gorvette" and Package 3 you get Ramone "doc Hudson" "radiator springs sheriff". Utilizing a unique ball-bearing design, these collectible characters can race, drift, swarm and even self-correct themselves to always face in a forward direction when played with on a track set. \r\n\r\n\r\nAccording to Wiki Pixar the Republic of New Rearendia is desperate to put their name on the map with racecar #10 open-wheeled racer Rip Clutchgoneski. He participated in all 3 World Grand Prix races, as well as in the Radiator Springs Grand Prix. Republic of New Rearendia is a fictional country. The colors of its flag are orange, green & red. Rip is the only racer in WGP that doesn''t have a crew chief, just some pitties.\r\n\r\nHere''s how Cars2 is called in other countries:  Arabalar, Autogrotesky, Аутомобили Cars2 "Arabalar 2" "Auta 2" "Auti 2" "Automobili 2" "Autod 2" "Autot 2" "Bilar 2" "Bilar 2" e "Cars 2" "Carros 2" "Les Bagnoles 2"  "Mankanebi 2" "Masini 2" "Ratai 2" "Тачки 2" e "Tachky 2" "Verdák 2"  "カーズ 2" "Les Bagnoles animées" "汽車總動員 2" "Cars Motori Ruggenti" "Cars Quatre roues" "bujdy na resorach" "Złomka bujdy na resorach"\r\n\r\n\r\nWatch Play-Doh Superheroes Cars Make n Display Spiderman Hulk Stage Show with Disney Pixar Cars Play Doh Batman vs. Superman facing each other. Here you''ll see Marvel Super Heroes Cars the Avengers like Batman as Doc Hudson, Captain America Lightning McQueen, Mater Superman, Mack Truck as Pit Crew Chief with headset and Sally Carrera Pit Crew with Headset, watch only at Toychannel Disneycollector:\r\nhttps://www.youtube.com/watch?v=GVa1foHZ-fU\r\n\r\nCheck out "Play-Doh Doggy Doctor" Playset and take care of play-doh puppies:\r\nhttps://www.youtube.com/watch?v=DOW-9LUcrPo\r\n\r\nWatch "Play-Doh Octopus" Playset Ocean Animals with Disney Finding Nemo Dory:\r\nhttps://www.youtube.com/watch?v=EwyncHfcRgE\r\n\r\nCheck Out "Play-Doh Coco Nutty Monkey" Playset and watch nutty Monkey eating play doh bananas with Despicable Me action figure Dave singing banana at:\r\nhttps://www.youtube.com/watch?v=DOW-9LUcrPo\r\n\r\nWatch Play-Doh Trains Planes Cars Trucks Choppers with Play Dough Vehicles set:\r\nhttps://www.youtube.com/watch?v=RuwR1jmFYAM\r\n\r\nCheck out "Play-Doh Star Wars" The Clone Wars R2-D2 playset w/  Darth Mater,Luke Skywalker Lightning McQueen, Frank Tractor Tippin'' Stormtrooper, Jabba the Hutt at:\r\nhttp://www.youtube.com/watch?v=YHkSPgo5hqQ\r\n\r\nWatch Play-Doh Buster Power Crane Wrecking Ball From Tonka Trucks at:\r\nhttps://www.youtube.com/watch?v=wD1rKL8N8R0\r\n\r\nWatch "Play-Doh Mold N Go Speedway" Playset with Disney Pixar Cars Tuners Mater Hot Rod Boost Snot Rod, Wingo with Flames Francesco as Rip Clutchgoneski at:\r\nhttps://www.youtube.com/watch?v=K0wRMSDZbfM\r\n\r\nLearn the Alphabet ABC with "Cookie Monster Eats Cars" Micro Drifters and Play-Doh Letter Lunch Cookie Monster From Sesame Street, watch and learn ABC''s at:\r\nhttps://www.youtube.com/watch?v=W67E90h8GTY\r\n\r\nEnjoy Cookie Monster Pool Party with Disney Pixar Cars Hydro Wheels Underwater toys Mater, Rip Clutchgoneski and K''NEX Building Toys like Lego, watch at:\r\nhttps://www.youtube.com/watch?v=SMbNjTXSpCk', 'native', NULL, NULL, '', NULL, 1, '', 0, 'inactive', 'pending', '2014-03-02 01:25:10', '2015-06-30 20:21:53'),
