(7, 'BluCollection', '1', NULL, 'http://youtu.be/wZINpnFAiUA', NULL, 'wZINpnFAiUA', 'https://i1.ytimg.com/vi/wZINpnFAiUA/default.jpg', 'https://i1.ytimg.com/vi/wZINpnFAiUA/hqdefault.jpg', 'youtube', 'drama', 'Play Doh Transformers Autobot Workshop Playset Transform Lightning McQueen in Autobots Disney Cars', 'This is play doh Transformers Autobot Workshop play set from Dark of the Moon with bumblebee, Ironhide, Megatron and Optimus Prime. Roll cars into the workshop and watch as they transform into robots! This playset comes with 4 cans, 4 car molds and sculpting tools to help build your favorite Transformers Best of all with this set you can transform your Disney Pixar play-doh cars into autobots. In this video i''m transforming Cars 2 Lightning McQueen, Raoul Caroule and Francesco Bernoulli into robots. Thanks for watching my car-toys reviews by blucollection.\r\n\r\nThe Autobots also known as Cybertrons are the heroes in the Transformers toyline and related spin-off comics and cartoons. Their main leader is Optimus Prime. They are constantly at war with the Decepticons. Dark side of the Moon is the third film from the seriesin which the Decepticons unveil a plan to enslave humanity in order to bring back Cybertron, the home planet of the Transformers.\r\n\r\nAccording to wiki pixar racer #95 Mcqueen  is sponsored by Rust-eze racing. He also appears in Cars Toons Mater''s Tall Tales. He''s also called in other countries: Bliksem, Saetta, Lynet, El Rayo, Flash, Blixten, Faísca, Blesk, Şimsek, Relâmpago, Zygzaka McQueen" "Молния МакКуин" ライトニング・マックィーン.\r\n\r\nWatch Play-Doh Superheroes Cars Make n Display Spiderman Hulk Stage Show with Disney Pixar Cars Play Doh Batman vs. Superman facing each other. Here you''ll see Marvel Super Heroes Cars the Avengers like Batman as Doc Hudson, Captain America Lightning McQueen, Mater Superman, Mack Truck as Pit Crew Chief with headset and Sally Carrera Pit Crew with Headset, watch only at Toychannel Disneycollector:\r\nhttps://w