(8, 'HeIIo Kitty', '1', NULL, 'http://youtu.be/cnUi1ii30Ek', NULL, 'cnUi1ii30Ek', 'https://i1.ytimg.com/vi/cnUi1ii30Ek/default.jpg', 'https://i1.ytimg.com/vi/cnUi1ii30Ek/hqdefault.jpg', 'youtube', 'drama', 'Hello Kitty full episode   Paradise Part 3', 'Hello Kitty (ハローキティ Harō Kiti?)[3] (full name Kitty White (キティ・ホワイト Kiti howaito?))[2] is a fictional character produced by the Japanese company Sanrio, first designed by Yuko Shimizu. She is portrayed as a female white Japanese bobtail cat with a red bow.[1] The character''s first appearance on an item, a vinyl coin purse, was introduced in Japan in 1974 and brought to the United States in 1976.[4][5] The character is a staple of the kawaii segment of Japanese popular culture.[6] At age 36 as of 2010, Sanrio has groomed Hello Kitty into a global marketing phenomenon worth $5 billion a year.[7]\r\n\r\nOriginally aimed at pre-adolescent females, Hello Kitty''s market has broadened to include adult consumers. She can be found on a variety of products ranging from school supplies to fashion accessories and high-end consumer products. Several Hello Kitty TV series, targeted towards young children, have been produced. Hello Kitty is also the main character at the two Japanese Sanrio theme parks, Harmonyland and the indoor Sanrio Puroland.\r\n\r\nHello Kitty is originaly Japanese, "Hello Kitty" refers to the group of related characters, while the main character herself is known as Kitty White (キティ・ホワイト Kiti Howaito?), or affectionately as Kitty-chan (キティちゃん Kiti-chan?). According to the official character profile, she was born in the suburbs of London, England on November 1. Her height is described as five apples and her weight as three apples. She is portrayed as a bright and kind-hearted girl, very close to her twin sister Mimmy. She is good at baking cookies and loves Mama''s homemade apple pie. She likes to collect cute things and her favorite subjects in school are English, music and art.[2][8]\r\n\r\nHello Kitty is portrayed surrounded by a large family who all possess the surname ''White.'' Her twin sister Mimmy is described as "shy and very girly," interested in sewing and dreaming of marriage. While Hello Kitty wears a bow on her left ear, Mimmy wears hers on the right. Also Hello Kitty''s dresses are normally red, whereas Mimmy''s are normally yellow. Their Papa, George, is described as dependable, humorous but also absent-minded. Mama, Mary, is portrayed as a good cook who loves doing housework. Grandpa Anthony likes to tell stories and Grandma Margaret likes sewing.[8] Dear Daniel is Hello Kitty''s childhood friend. His character profile describes him as born in London on May 3 with the real name Daniel Starr. He travelled with his parents and was away from Hello Kitty for a long time. He is portrayed as fashionable and sensitive, good at dancing and playing the piano, with an interest in photography and dreams of being a celebrity.[9] Charmmy Kitty is Hello Kitty''s pet, a white Persian. She is described as docile, obedient and fond of shiny things. Her necklace holds the key to Hello Kitty''s jewelry box.[10] Hello Kitty also has a pet hamster named Sugar, who was a gift from Dear Daniel', 'native', NULL, NULL, '', NULL, 1, '', 0, 'approved', 'pending', '2014-03-02 01:26:47', '2015-06-28 10:35:09'),
(9, 'X-Men Movies', '1', NULL, 'http://youtu.be/pK2zYHWDZKo', NULL, 'pK2zYHWDZKo', 'https://i1.ytimg.com/vi/pK2zYHWDZKo/default.jpg', 'https://i1.ytimg.com/vi/pK2zYHWDZKo/hqdefault.jpg', 'youtube', 'drama', 'X-MEN: DAYS OF FUTURE PAST - Official Trailer (2014)', 'The ultimate X-Men ensemble fights a war for the survival of the species across two time periods in X-MEN: DAYS OF FUTURE PAST. The beloved characters from the original "X-Men" film trilogy join forces with their younger selves from "X-Men: First Class," in an epic battle that must change the past -- to save our future.\r\n\r\nFOLLOW on Facebook: www.facebook.com/XMenMovies\r\nwww.x-menmovies.com\r\nwww.youtube.com/xmenmovies', 'native', NULL, NULL, '', NULL, 1, '', 0, 'approved', 'pending', '2014-03-02 01:39:47', '2015-06-28 10:35:09'),
