(206, 'Zainul Abdeen', 'Zainul Abdeen', NULL, 'https://www.youtube.com/watch?v=FO5k1HmWQP4', NULL, 'FO5k1HmWQP4', 'https://i.ytimg.com/vi/FO5k1HmWQP4/default.jpg', 'https://i.ytimg.com/vi/FO5k1HmWQP4/mqdefault.jpg', 'youtube#video', 'drama', 'Game of Thrones Season 5 Finale Episode 10 is called ''Mother''s Mercy''', 'Game of Thrones Season 5 Finale Episode 10''s Title is ''Mother''s Mercy''\n\nAlright what''s going on guys it''s Trev back again here to bring you another video.  In this one I will be giving my thoughts on the title of the Game of Thrones Season 5 Finale.  We now know it is called, Mother''s Mercy.  Mother Mercy is another name or alias of Lady Stoneheart.  Spoilers to follow...\n\n\nLady Stoneheart is the undead mother of Sansa, Robb, Arya, Rickon, and Bran Stark. Catelyn Stark or Tully was seemingly killed at the events of the Red Wedding in Game of Thrones Season 3.  In the books a song of ice and fire she is resurrected afterwards by Thoros of Myr.  Will we see her come back in the tv series version as well?  I sure hope so and a few subscribers requested I give my thoughts on this one so I figured yeah why not.  I hope you all enjoy it.\n\nA very special thank you to HBO for sending us some promotional items to give away this season.  Check out the HBO store in the link below:\n\nhttp://tinyurl.com/gameofthronesstore\n\nPlot of the finale:\n\n“Stannis marches. Dany is surrounded by strangers. Cersei seeks forgiveness. Jon is challenged.”\n\nCheck out my who is lady stoneheart video here:\n\nhttps://www.youtube.com/watch?v=RgVB8oWUxzo\n\nTrevschan2 Youtube Channel:\nwww.youtube.com\\trevschan2\n\nCheck out my Facebook Page:\nhttps://www.facebook.com/trevschan2\n\nFollow me on Twitter:\nhttps://twitter.com/trevschan2\n\nCheck out my Tumblr Page:\nhttp://trevschan2.tumblr.com/\n\nTrevschan2 Google+:\nhttps://plus.google.com/105248049992347380221/posts\n\nTrevschan2 Blogger:\nhttp://trevschan2.blogspot.ca/\n\nWho Would Win Vs Series:\nhttps://www.youtube.com/playlist?list=PLDE914A350C7F7B30', 'native', 9223372036854775807, 'Zainul Aabdeen', '', NULL, 1, '', 0, 'approved', 'pending', '2015-06-29 11:02:33', '2015-06-29 05:32:33'),
